guimove-mouse-tracking-internals (s1: symbol, W : class g2-window, IV1:item-or-value, IV2:item-or-value, I1:integer, I2:integer, I3:integer, I4:integer)
IO: item-or-value;
wait-threshold : integer = 1;
loop-count : integer = 0;
V : class logical-parameter;
DEBUG: truth-value =false;
begin
if DEBUG then
    inform the operator that "Event:>[s1] on a 1)[the class of IV1] and 2)[the class of IV2]";

IO = call uil-find-initiating-object (the uil-dialog superior to the workspace of Iv1);

if s1 = the symbol enter then
  begin
    create a logical-parameter V;
    conclude that V is now the-mouse-press-state-of W; 
    call upp-lower-button (IV1, s1);

    if IV1 is the same object as IV2 then 
         call upp-insert-button-actions-into-dialog-event-queue (IV1, the uil-dialog superior to the workspace of Iv1, W)
    else
        begin
            call upp-raise-button (IV1, s1); 
            return;
        end;
  
     wait for .25 seconds;
     if not (V exists ) then 
        begin 
            call upp-raise-button (IV1, s1); 
            return;
        end;
     repeat 
        exit if not (V exists);
        if IV1 is the same object as IV2 then                     
            call upp-insert-button-actions-into-dialog-event-queue (IV1, the uil-dialog superior to the workspace of Iv1, W)
        else
            exit if true; 
        loop-count = loop-count + 1; 
        call g2-work-on-drawing (the workspace of IO); 
        if loop-count > wait-threshold then
            wait for .005 seconds
        else
            wait for .5 seconds;
    end ; 
    call upp-raise-button (IV1, s1); 
    return;
  end;

if S1 = the symbol leave then 
  begin
    if the logical-parameter that is  the-mouse-press-state-of W exists then
      begin
        V = the logical-parameter that is  the-mouse-press-state-of W;
        delete V;
      end;
    call upp-raise-button (IV1, s1);
    return;
  end;
end

guimove-move-item-to-position (D: class uil-dialog, W: class ui-client-item )
TSO: class guimove-temporary-storage-object;
B: class item;
X-EB, Y-EB: class uil-edit-box;
BDR: item-or-value;
X, Y, XOffset, YOffset: integer;
DEBUG: truth-value = false;
begin
if DEBUG then
    inform the operator that "Running guimove-set-item-position";

    B = the item that is the-object-initiating-dialog-activity-for D;

    X-EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("guimove-x-eb", D);
    X = quantity ("[the message-contents of X-EB]");
    Y-EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("guimove-y-eb", D);
    Y = quantity ("[the message-contents of Y-EB]");

    TSO = the guimove-temporary-storage-object that is the-uil-temporary-storage-object-of D;
    XOffset = the guimove-x-offset of TSO;
    YOffset = the guimove-y-offset of TSO;

    {-- Check how user wants to position item --}
    case (the guimove-position-item-by of TSO) of
        top-left:
            begin
            X = X + XOffset;
            Y = Y - YOffset;
            end;
        top-center: Y = Y - YOffset;     
        top-right:
            begin
            X = X - XOffset;
            Y = Y - YOffset;
            end;
        center-left: X = X + XOffset;
        center: begin end;
        center-right: X = X - XOffset;
        bottom-left:
            begin
            X = X + XOffset;
            Y = Y + YOffset;
            end;
        bottom-center: Y = Y + YOffset;
        bottom-right:
            begin
            X = X - XOffset;
            Y = Y + YOffset;
            end;
    end;

    move  B to (X, Y);

    if (B is a uil-grobj or B is a uil-grmes) then
        begin
        call uil-move-grobj (B); 

        BDR = call uil-get-border (B);
        if (B is a uil-grmes and the uil-stand-alone-text of B exists and the uil-stand-alone-text of B is true and (BDR exists and BDR is an item)) then
            call uil-move-related-border (B);
        end
    else
        call upp-make-item-permanent (B);
end

guimove-setup-positioning-dialog (D: class uil-dialog, B: item-or-value, W: item-or-value, O: item-or-value, SL: class symbol-list)
TSO: class guimove-temporary-storage-object;
T: class uil-text;
TB: class uil-button;
DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "Running guimove-setup-positioning-dialog";

    TSO = the guimove-temporary-storage-object that is the-uil-temporary-storage-object-of the uil-dialog that is the-uil-parent-dialog-of-this-cascaded-dialog D;
    T = call uil-get-grobj-from-id-on-dlg-or-wksp ("guimove-position-text", D);
    call uil-update-text (T, "[the guimove-position-item-by of TSO]");

    for TB = each guimove-position-button upon the subworkspace of D do
        if (DEBUG) then
            inform the operator that "checking out: [the user-data of TB]  toggle-state: [the toggle-state of TB]";

        if (the toggle-state of TB is on) then
            conclude that the toggle-state of TB is off;

        call uil-configure-grobj (TB);

        if ("[the user-data of TB]" = "[the guimove-position-item-by of TSO]") then
            begin
            conclude that the toggle-state of TB is on;
            call uil-configure-grobj (TB);
            end;
        end;
end

guimove-move-item-event (D:class uil-dialog, O:class item, W:class ui-client-item, B: item-or-value, SL:class symbol-list)
WS: class kb-workspace;
TSO: class guimove-temporary-storage-object;
EB: class uil-edit-box;
BDR: item-or-value;
INC: integer;
DEBUG: truth-value = false;
begin
if DEBUG then
    inform the operator that "Running guimove-move-item-event";

    TSO = the guimove-temporary-storage-object that is the-uil-temporary-storage-object-of D;

    INC = the guimove-increment-to-move of TSO;

    if O is a guimove-directional-left-button then
        move B by  ( - inc, 0)

    else if O is a guimove-directional-right-button then 
        move B by (inc, 0)

    else if O is a guimove-directional-up-button then
        move B by (0, inc)

    else if O is a guimove-directional-down-button then
        move B by (0, - inc);

    if (B is a uil-grobj or B is a uil-grmes) then
        begin
        call uil-move-grobj (B);

        BDR = call uil-get-border (B);
        if (B is a uil-grmes and the uil-stand-alone-text of B exists and the uil-stand-alone-text of B is true and BDR exists and BDR is an item) then
            call uil-move-related-border (B);

        call uil-make-grobj-permanent (B);
        end
    else
        begin
        call upp-make-item-permanent (B);
        end;

    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("guimove-x-eb", D);
    call uil-update-text (EB, "[the item-x-position of B]");
    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("guimove-y-eb", D);
    call uil-update-text (EB, "[the item-y-position of B]");
    if (the workspace of B exists) then 
        begin
        WS = the workspace of B;
        if (WS is a kb-workspace) then
            call uil-adjust-border-on-workspace (WS);
        end;
end

guimove-set-positioning-method (B: class uil-button, W:class ui-client-item, WS: class item)
D: class uil-dialog;
TSO: class guimove-temporary-storage-object;
Obj: class item;
T: class uil-text;
TB: class uil-button;
S: symbol;
Width, Height, XOffset, YOffset: integer;
FOUND: truth-value = false;
DEBUG: truth-value = false;
begin
if DEBUG then
    inform the operator that "Running guimove-setpositioning-method: [the user-data of B]";

    D = the uil-dialog superior to the workspace of B;

    for TB = each guimove-position-button upon the subworkspace of D do
        if (the toggle-state of TB is on and TB is not the same object as B) then
            begin
            conclude that the toggle-state of TB is off;
            call uil-configure-grobj (TB);
            FOUND = true;
            end;
        exit if FOUND;
        end;

    T = call uil-get-grobj-from-id-on-dlg-or-wksp ("guimove-position-text", WS);
    call uil-update-text (T, "[the user-data of B]");

    TSO = the guimove-temporary-storage-object that is the-uil-temporary-storage-object-of the uil-dialog that is the-uil-parent-dialog-of-this-cascaded-dialog D;
    S = text-to-symbol ("[the user-data of B]");
    conclude that the guimove-position-item-by of TSO = S;

    Obj = the item that is the-object-initiating-dialog-activity-for the uil-dialog that is the-uil-parent-dialog-of-this-cascaded-dialog D;
    
    Width = the item-width of Obj;
    Height = the item-height of Obj;

    XOffset = round (Width/2);
    YOffset = round (Height/2);
   
    conclude that the guimove-x-offset of TSO = XOffset;
    conclude that the guimove-y-offset of TSO = YOffset;

    call guimove-move-item-to-position (the uil-dialog that is the-uil-parent-dialog-of-this-cascaded-dialog D, W);
end

guimove-update-dialog-from-item (G: class item, D: class uil-dialog)
EB: class uil-edit-box;
DEBUG: truth-value = false;
begin
if (DEBUG) then
    inform the operator that "Running guimove-update-dialog-from-item";

    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("guimove-x-eb", D);
    call uil-update-text (EB, "[the item-x-position of G]");
    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("guimove-y-eb", D);
    call uil-update-text (EB, "[the item-y-position of G]");
end

guimove-user-adjust-increment (EB: class uil-edit-box, D: class uil-dialog, W: class ui-client-item, EditCommitted: truth-value)
TSO: class guimove-temporary-storage-object;
DEBUG: truth-value = false;
begin
if DEBUG then
    inform the operator that "Running guimove-user-adjust-increment";

    call uil-edit-box-unselection (EB, D, W, EditCommitted);

    TSO = the guimove-temporary-storage-object that is the-uil-temporary-storage-object-of D;

   conclude that the guimove-increment-to-move of TSO = quantity ("[the message-contents of EB]");
end

guimove-set-item-position (EB: class uil-edit-box, D: class uil-dialog, W: class ui-client-item, EditCommitted: truth-value)
DEBUG: truth-value = false;
begin
if DEBUG then
    inform the operator that "Running guimove-set-item-position";

    call uil-edit-box-unselection (EB, D, W, EditCommitted);
    call guimove-move-item-to-position (D, W);   
end

guimove-setup (D:class uil-dialog, O:class item, W:class ui-client-item , B: item-or-value, SL:class symbol-list)
EB: class uil-edit-box;
DEBUG: truth-value = false;
begin
if DEBUG then
    inform the operator that "Running guimove-setup";
    
    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("guimove-x-eb", D);
    call uil-update-text (EB, "[the item-x-position of B]");
    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("guimove-y-eb", D);
    call uil-update-text (EB, "[the item-y-position of B]");
    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("guimove-increment-eb", D);
    call uil-update-text (EB, "1");
end

guimove-adjust-increment (D:class uil-dialog, O:class item, W:class ui-client-item, B: item-or-value, SL:class symbol-list)
TSO: class guimove-temporary-storage-object;
EB: class uil-edit-box;
DEBUG: truth-value = false;
begin
if DEBUG then
    inform the operator that "Running guimove-adjust-increment";

    EB = call uil-get-grobj-from-id-on-dlg-or-wksp ("guimove-increment-eb", D);
    TSO = the guimove-temporary-storage-object that is the-uil-temporary-storage-object-of D;

    if (O is a uil-up-arrow-pushbutton) then
        conclude that the guimove-increment-to-move of TSO = the guimove-increment-to-move of TSO + 1
    else
        conclude that the guimove-increment-to-move of TSO = max (1, the guimove-increment-to-move of TSO - 1);

    call uil-update-text (EB, the guimove-increment-to-move of TSO);
end
